import React from 'react';

function Home() {
  const isAuthenticated = false; // Zmień na prawdziwą logikę uwierzytelniania

  return (
    <div className="page">
      {isAuthenticated ? (
        <h1>Witamy</h1>
      ) : (
        <a href="/auth/discord">Zaloguj się poprzez Discord</a>
      )}
    </div>
  );
}

export default Home;
